INSERT INTO `bd4hbxsz5_messages` (`message_id`, `sender_id`, `date_added`, `send_type`, `recipient`, `subject`, `body`, `status`) VALUES ('66', '11', '2015-10-24 20:50:41', 'account', 'all_customers', 'Why moderate questions and replies?', '<table style=\"display: table;\" id=\"textEdit\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">  <tbody>    <tr>      <td styleclass=\" style_Content\" style=\"color: #000000; font-family: Georgia,&quot;Times New Roman&quot;,Times,serif; font-size: 11pt; padding: 8px 20px 9px;\" valign=\"top\" align=\"left\">        <div>With half-term round corner, Saint Lucia is the ideal family destination for your clients to enjoy a family holiday.</div>        <br>        <div>With soft sandy beaches to play on, warm turquoise seas to jump in, magical mountains and lush rainforests to explore, it\'s hard to imagine a more feel-good family destination.</div>        <div><span style=\"font-size: 11pt;\">Your clients can enjoy activities such as rainforest zip-lining, biking, horseback riding and so much more and relax in family friendly accommodation.&nbsp;</span></div>        <br>        <div>Visit our <a style=\"color: blue; text-decoration: underline;\" track=\"on\" shape=\"rect\" href=\"http://saintluciauk.org/september/family-fun/\" linktype=\"1\" target=\"_blank\">website</a> for offers to Saint Lucia for your clients.</div>        <br>        <div>          <table class=\"OneColumnMobile\" data-padding-converted=\"true\" cellpadding=\"0\" cellspacing=\"0\" width=\"580\" align=\"none\">            <tbody>              <tr>                <td style=\"padding-top: 5px; padding-right: 0px; padding-left: 0px; padding-bottom: 5px; color: #000000;\" width=\"1%\">                  <div align=\"center\"><img name=\"ACCOUNT.IMAGE.867\" src=\"https://mlsvc01-prod.s3.amazonaws.com/06e50a22101/785270f8-4a18-413c-b579-2b6672fb3fa6.jpg\" height=\"27\" hspace=\"0\" border=\"0\" vspace=\"0\" width=\"580\"></div>                </td>              </tr>            </tbody>          </table>        </div>        <br>        <div><span style=\"font-size: 11pt;\">          <table class=\"OneColumnMobile\" data-padding-converted=\"true\" cellpadding=\"0\" cellspacing=\"0\" width=\"300\" align=\"center\">            <tbody>              <tr>                <td style=\"padding: 5px; color: #000000;\" width=\"1%\">                  <div align=\"center\"><a class=\"imgCaptionAnchor\" track=\"on\" shape=\"rect\" href=\"https://youtu.be/pzNLpaOLeCM\"><img src=\"https://thumbnail.constantcontact.com/remoting/v1/vthumb/YOUTUBE/8a1a278e0c2b49a1aa491cdfe363cc06\" height=\"225.00\" hspace=\"0\" border=\"0\" vspace=\"0\" width=\"300\"></a>&nbsp;</div>                </td>              </tr>            </tbody>          </table>          </span></div>        <br>        <div><span style=\"font-size: 11pt;\"><a style=\"color: #0000ff; text-decoration: underline;\" track=\"on\" shape=\"rect\" href=\"http://saintluciauk.org/september/family-fun/\" linktype=\"1\" target=\"_blank\">Click here</a>&nbsp;to book the ultimate family holiday for your clients.&nbsp;</span></div>        <div><span style=\"font-size: 11pt;\">&nbsp;</span></div>        <div><span style=\"font-size: 11pt;\">Still up for grabs is <strong>£100 Love2Shop voucher</strong>. Don\'t forget to log your bookings on <a style=\"color: blue; text-decoration: underline;\" href=\"http://www.SaintLuciaExpert.com\" shape=\"rect\">www.SaintLuciaExpert.com</a>&nbsp;for your chance to win.</span></div>        <div><span style=\"font-size: 11pt;\">&nbsp;</span></div>        <div><span style=\"font-size: 11pt;\">          <table class=\"OneColumnMobile\" data-padding-converted=\"true\" cellpadding=\"0\" cellspacing=\"0\" width=\"591\" align=\"none\">            <tbody>              <tr>                <td style=\"padding-top: 5px; padding-right: 0px; padding-left: 0px; padding-bottom: 5px; color: #000000;\" width=\"1%\">                  <div align=\"center\"><img name=\"ACCOUNT.IMAGE.868\" src=\"https://mlsvc01-prod.s3.amazonaws.com/06e50a22101/d242e5ba-51e1-4fd0-93df-71fb5aef6c91.jpg\" height=\"28\" hspace=\"0\" border=\"0\" vspace=\"0\" width=\"591\"></div>                </td>              </tr>            </tbody>          </table>          </span></div>      </td>    </tr>  </tbody></table>', '1');
